import React from 'react';
import { Link } from 'react-router-dom';

export default function Home() {
  return (
    <section className="container mx-auto p-4 text-center">
      <h2 className="text-3xl font-bold mb-4">Welcome to My Restaurant!</h2>
      <p className="mb-4">Delicious food, fresh ingredients, and cozy atmosphere.</p>
      <Link to="/menu" className="bg-blue-500 text-white px-4 py-2 rounded hover:bg-blue-600">
        See Menu
      </Link>
    </section>
  );
}
